import { Switch, TextField } from "@mui/material";
import { useState } from "react";

const ByeSell = () => {
  const [state, setState] = useState([true, true, true, true]);

  const handleChange = (i) => {
    const old = [...state];
    old[i] = !old[i];
    setState(old);
    alert("button Clicked");

    console.log(old[i] ? `Switch ${i + 1} On` : `Switch ${i + 1} Off`);
  };

  return (
    <div
      style={{
        height: "100vh",
        width: "100%",
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
      }}
    >
      <div
        style={{
          height: "50%",
          width: "90%",
          background: "white",
          display: "flex",
        }}
      >
        <div
          style={{
            flex: 5,
            display: "flex",
            padding: 10,
            boxShadow:
              "rgba(0, 0, 0, 0.07) 0px 1px 2px, rgba(0, 0, 0, 0.07) 0px 2px 4px, rgba(0, 0, 0, 0.07) 0px 4px 8px, rgba(0, 0, 0, 0.07) 0px 8px 16px, rgba(0, 0, 0, 0.07) 0px 16px 32px, rgba(0, 0, 0, 0.07) 0px 32px 64px",
          }}
        >
          <div
            style={{
              flex: 5,
              display: "flex",
              alignItems: "center",
              justifyContent: "space-around",
              flexDirection: "column",
            }}
          >
            <TextField
              label="Coin Name"
              style={{
                boxShadow:
                  "rgba(14, 30, 37, 0.12) 0px 2px 4px 0px, rgba(14, 30, 37, 0.32) 0px 2px 16px 0px",
              }}
            />
            <TextField
              label="Coin Name"
              style={{
                boxShadow:
                  "rgba(14, 30, 37, 0.12) 0px 2px 4px 0px, rgba(14, 30, 37, 0.32) 0px 2px 16px 0px",
              }}
            />
            <TextField
              label="Coin Name"
              style={{
                boxShadow:
                  "rgba(14, 30, 37, 0.12) 0px 2px 4px 0px, rgba(14, 30, 37, 0.32) 0px 2px 16px 0px",
              }}
            />
            <h1
              style={{
                fontSize: 22,
                display: "flex",
                justifyContent: "center",
                alignItems: "center",
                boxShadow: "rgba(0, 0, 0, 0.1) 0px 10px 50px",
              }}
            >
              COIN NAME
            </h1>
            <h1
              style={{
                fontSize: 22,
                display: "flex",
                justifyContent: "center",
                alignItems: "left",
              }}
            >
              BUYING AMOUNT
            </h1>
            <h1
              style={{
                fontSize: 22,
                display: "flex",
                justifyContent: "center",
                alignItems: "left",
              }}
            >
              SELLING AMOUNT
            </h1>
            <h1
              style={{
                fontSize: 22,
                display: "flex",
                justifyContent: "center",
                alignItems: "left",
              }}
            >
              GRID AMOUNT
            </h1>
          </div>
          <div
            style={{
              flex: 5,
              display: "flex",
              alignItems: "center",
              justifyContent: "space-around",
              flexDirection: "column",
            }}
          >
            <div
              style={{
                height: "15%",
                width: "60%",
                boxShadow:
                  "rgba(0, 0, 0, 0.07) 0px 1px 2px, rgba(0, 0, 0, 0.07) 0px 2px 4px, rgba(0, 0, 0, 0.07) 0px 4px 8px, rgba(0, 0, 0, 0.07) 0px 8px 16px, rgba(0, 0, 0, 0.07) 0px 16px 32px, rgba(0, 0, 0, 0.07) 0px 32px 64px",
                display: "flex",
                alignItems: "center",
                justifyContent: "center",
                borderRadius: 8,
              }}
            >
              div_1
            </div>
            <div
              style={{
                height: "15%",
                width: "60%",
                boxShadow:
                  "rgba(0, 0, 0, 0.07) 0px 1px 2px, rgba(0, 0, 0, 0.07) 0px 2px 4px, rgba(0, 0, 0, 0.07) 0px 4px 8px, rgba(0, 0, 0, 0.07) 0px 8px 16px, rgba(0, 0, 0, 0.07) 0px 16px 32px, rgba(0, 0, 0, 0.07) 0px 32px 64px",
                display: "flex",
                alignItems: "center",
                justifyContent: "center",
                borderRadius: 8,
              }}
            >
              div_2
            </div>
            <div
              style={{
                height: "15%",
                width: "60%",
                boxShadow:
                  "rgba(0, 0, 0, 0.07) 0px 1px 2px, rgba(0, 0, 0, 0.07) 0px 2px 4px, rgba(0, 0, 0, 0.07) 0px 4px 8px, rgba(0, 0, 0, 0.07) 0px 8px 16px, rgba(0, 0, 0, 0.07) 0px 16px 32px, rgba(0, 0, 0, 0.07) 0px 32px 64px",
                display: "flex",
                alignItems: "center",
                justifyContent: "center",
                borderRadius: 8,
              }}
            >
              div_3
            </div>
            <div
              style={{
                height: "15%",
                width: "60%",

                boxShadow:
                  "rgba(0, 0, 0, 0.07) 0px 1px 2px, rgba(0, 0, 0, 0.07) 0px 2px 4px, rgba(0, 0, 0, 0.07) 0px 4px 8px, rgba(0, 0, 0, 0.07) 0px 8px 16px, rgba(0, 0, 0, 0.07) 0px 16px 32px, rgba(0, 0, 0, 0.07) 0px 32px 64px",
                display: "flex",
                alignItems: "center",
                justifyContent: "center",
                borderRadius: 8,
              }}
            >
              div_4
            </div>
          </div>
        </div>
        <div
          style={{
            flex: 5,
            display: "flex",
            padding: 10,
            boxShadow:
              "rgba(0, 0, 0, 0.07) 0px 1px 2px, rgba(0, 0, 0, 0.07) 0px 2px 4px, rgba(0, 0, 0, 0.07) 0px 4px 8px, rgba(0, 0, 0, 0.07) 0px 8px 16px, rgba(0, 0, 0, 0.07) 0px 16px 32px, rgba(0, 0, 0, 0.07) 0px 32px 64px",
          }}
        >
          {" "}
          <div
            style={{
              flex: 5,
              display: "flex",
              alignItems: "center",
              justifyContent: "space-around",
              flexDirection: "column",
            }}
          >
            <h1
              style={{
                fontSize: 22,
                alignItems: "center",
                display: "flex",
                justifyContent: "center",
              }}
            >
              AUTO SELLING
            </h1>
            <h1
              style={{
                fontSize: 22,
                alignItems: "center",
                display: "flex",
                justifyContent: "center",
              }}
            >
              AUTO BUYING
            </h1>
            <h1
              style={{
                fontSize: 22,
                alignItems: "center",
                display: "flex",
                justifyContent: "center",
              }}
            >
              SELLING AMOUNT
            </h1>
            <h1
              style={{
                fontSize: 22,
                alignItems: "center",
                display: "flex",
                justifyContent: "center",
              }}
            >
              GRID AMOUNT
            </h1>
          </div>
          <div
            style={{
              flex: 5,
              display: "flex",
              alignItems: "center",
              justifyContent: "space-around",
              flexDirection: "column",
            }}
          >
            {state.map((isChecked, i) => (
              <div
                key={i}
                style={{
                  height: "15%",
                  width: "60%",
                  display: "flex",
                  alignItems: "center",
                  justifyContent: "center",
                  borderRadius: 8,
                  boxShadow:
                    "rgba(0, 0, 0, 0.07) 0px 1px 2px,rgba(0, 0, 0, 0.07) 0px 2px 4px, rgba(0, 0, 0, 0.07) 0px 4px 8px, rgba(0, 0, 0, 0.07) 0px 8px 16px, rgba(0, 0, 0, 0.07) 0px 16px 32px, rgba(0, 0, 0, 0.07) 0px 32px 64px",
                }}
              >
                <Switch onChange={() => handleChange(i)} checked={isChecked} />
              </div>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
};

export default ByeSell;
